import React, { Component } from "react";

class NavBar extends Component {
  state = {};
  render() {
    return (
      <div>
        <nav class="navbar fixed-bottom navbar-light">
          <a class="navbar-brand navbar-primary" href="#">
            Navbar
          </a>
        </nav>
      </div>
    );
  }
}

export default NavBar;
